	VALUES (240111044332060091,UUID(),18453,'北京市',18454,'石景山区','启迪香山','','香山南路105号院','启迪香山项目承担着清华科技园主园区溢出功能，复制清华科技园主园经验，成功构建以科技园区为载体的创新服务体系，利用科技园在高科技企业孵化培育，风险投资等领域的资源和优势，以及主园区管理运营21年的成功经验，致力把该园区打造成京西香山脚下的创新、创业企业聚集区，移动互联网产业基地和科技金融服务示范区。形成北京启迪集团在京西的重要战略布局。依托启迪之星的“孵化服务+创业培训+天使投资+开放平台”等方式，培养科技创业领军人才，发掘推动科技创新创业项目，依靠政府的城市发展定位、发展战略，以及相关的优惠政策，借助启迪控股多年来的建设经验和发展实力打造的新一代国际化、智慧型的科技创新创业综合体，是清华科技园模式升级的标杆项目。本项目周边交通便利，主干道纵贯四五环，城市轻轨在园区东侧通行。项目由云总部、悦街区、创新坊及慧空间四部分组成 ，总建筑面积15.6万平米，其中，地上建筑面积9.1万平米，地下建筑面积6.5万平米。
• 目前拟入驻企业有：北京启迪集团、启迪之星孵化器、启迪巨人学校、启迪亚都、清华阳光、清华紫光等优秀科技创新型企业。 其中本项目为启迪之星孵化器量身打造了创新创业的平台, 结合石景山区的城市规划和发展战略，塑造区域内商务办公和商业配套、满足区域多样化需求，为创新创业企业的入驻搭建了全方位的服务平台，项目的建立将为石景山区带来大量的优秀人才、促进当地区域经济的快速发展。',0,1,2,UTC_TIMESTAMP(),1,192731,192732,UTC_TIMESTAMP(),999959);
