	VALUES (1040216,0,'PM','北京华清物业管理有限责任公司','    北京华清物业管理有限责任公司成立于一九九七年八月八日，是启迪控股股份有限公司的全资子公司，是清华科技园第一家取得物业管理二级资质并通过ISO9001国际质量管理体系和ISO14001国际环境体系认证的物业管理公司。公司自成立以来，以打造国际化物业服务体系为己任，不断汲取“空间有形、梦想无限”的发展理念，坚持以创新的精神开创企业的未来；以服务的精神提升企业的品牌；以开拓的精神推进业务的深化；以合作的精神推动事业的发展；以求实的精神提高企业的能力。遵循服务理念国际化、管理手段信息化、工作流程科学化、单项服务专业化、服务领域多样化、管理人员职业化的工作宗旨，规范管理，强化服务意识，不断提高服务质量。 北京华清物业管理有限责任公司实行董事会领导下的总经理负责制。根据公司辐射发展战略，通过自营或投资模式目前已形成了以北京 - 天津为中心的华北战略辐射区、以嘉兴 - 南京 - 苏州为中心的长三角战略辐射区、以曲阜为中心华东战略辐射区，服务面积 97 万平方米。同时根据公司专业化战略，组建了北京华清永生餐饮管理有限责任公司、北京启迪商务会馆有限公司、北京嗨咖文化发展有限公司，以及会议服务事业部、设备管理事业部、绿化保洁事业部等专业化团队，从事中高端餐饮服务以及员工餐饮、国际会议、建筑室内环境科技研发等专业服务。','/1040216',1,2,'ENTERPRISE',999959,1058282);

